      <div className="text-lg font-semibold tracking-tight">mirror</div>
      <div className="space-x-6 hidden md:flex text-sm font-medium text-neutral-600">
        <a href="#" className="hover:text-black">Home</a>
        <a href="#" className="hover:text-black">Work</a>
